import { isEmail } from 'util-helpers';
import { BizForm, BizFormItemAutoComplete, BizFormItemAutoCompleteProps } from 'antd-more';

// \u90AE\u7BB1\u540E\u7F00
const EmailSuffix = [
  '@qq.com',
  '@126.com',
  '@163.com',
  '@sina.com',
  '@gmail.com',
  '@hotmail.com',
  '@yahoo.com',
  '@outlook.com'
];

const normailzeEmail = (v?: string) => (v ? v.trim().toLowerCase() : v);

const ItemAutoCompleteEmail: React.FC<BizFormItemAutoCompleteProps> = ({ name, ...restProps }) => {
  // \u901A\u8FC7\u8868\u5355\u83B7\u53D6\u503C\uFF0C\u517C\u5BB9\u8868\u5355\u6709\u521D\u59CB\u503C\u6216\u624B\u52A8\u8BBE\u7F6E\u8868\u5355\u503C\u7684\u60C5\u51B5
  const form = BizForm.useFormInstance();
  const value = BizForm.useWatch(name, form);

  const options = React.useMemo(() => {
    if (!value) {
      return [];
    }

    const [valPrefix, valSuffix] = value.split('@');
    return EmailSuffix.filter((item) => !valSuffix || item.indexOf(valSuffix) > 0).map((item) => {
      const opt = valPrefix + item;
      return {
        label: opt,
        value: opt
      };
    });
  }, [value]);

  return (
    <BizFormItemAutoComplete
      name={name}
      validateTrigger="onBlur"
      extendRules={[
        {
          validator(rule, value) {
            if (value && !isEmail(value)) {
              return Promise.reject('\u8BF7\u8F93\u5165\u6B63\u786E\u7684\${label}');
            }
            return Promise.resolve();
          }
        }
      ]}
      options={options}
      normalize={normailzeEmail}
      {...restProps}
    />
  );
};

export default ItemAutoCompleteEmail;
