const renderView = (dom: React.ReactElement, props: BizFileViewerProps) => {
  try {
    const { file } = props;
    let url = '',
      name = '';

    if (typeof file === 'string') {
      url = file;
    } else {
      name = file.name;
      url = file.url || file.preview || URL.createObjectURL(file.originFileObj || file);
    }
    if (url && (name.slice(-4) === '.ofd' || url.slice(-4) === '.ofd')) {
      return <OfdView fileUrl={url} />;
    }
  } catch {
    /* empty */
  }
  return dom;
};

export default renderView;
