import { isArray } from 'ut2';
import { BizFormItemUpload, BizFormItemUploadProps } from 'antd-more';
import { uploadFile } from '../../services';

const MAX_SIZE = 20 * 1024 * 1024;

export interface ItemUploadImageProps extends Partial<BizFormItemUploadProps> {
  afterUpload?: (res: { file: File; fssId: string }) => void;
}

const ItemUploadImage: React.FC<ItemUploadImageProps> = ({
  afterUpload,
  onUpload,
  ...restProps
}) => {
  return (
    <BizFormItemUpload
      type="image"
      maxCount={1}
      maxSize={MAX_SIZE}
      onUpload={async (file) => {
        const res = await (onUpload ? onUpload(file) : uploadFile(file));
        afterUpload?.({ file, fssId: res.fssid });
        return {
          fileId: res.fssid
        };
      }}
      extendRules={[
        {
          validator(rule, value) {
            let hasErrorOrPending = false;
            if (isArray(value) && value.length > 0) {
              value.some((item) => {
                if (!item.response) {
                  hasErrorOrPending = true;
                }
                return hasErrorOrPending;
              });
            }
            return hasErrorOrPending ? Promise.reject() : Promise.resolve();
          }
        }
      ]}
      {...restProps}
    />
  );
};

export default ItemUploadImage;
