import { BizForm, BizFormItemTimeRange } from 'antd-more';
import { isArray } from 'ut2';
import dayjs from 'dayjs';
import DemoForm from './components/DemoForm';

const DEFAULT_TIME_FORMAT = 'HH:mm:ss';

/**
 * \u5224\u65AD\u65F6\u95F4\u8303\u56F4\u662F\u5426\u9009\u4E2D24\u5C0F\u65F6
 *
 * @param times \u65F6\u95F4\u8303\u56F4
 * @returns \u662F\u5426\u9009\u4E2D24\u5C0F\u65F6
 */
function isAllDay(times?: (string | dayjs.Dayjs)[]) {
  if (isArray(times) && times.length === 2) {
    const t0 = (dayjs.isDayjs(times[0]) ? times[0] : dayjs(times[0], DEFAULT_TIME_FORMAT)).format(
      DEFAULT_TIME_FORMAT
    );
    const t1 = (dayjs.isDayjs(times[1]) ? times[1] : dayjs(times[1], DEFAULT_TIME_FORMAT)).format(
      DEFAULT_TIME_FORMAT
    );
    return t0 === '00:00:00' && t1 === '23:59:59';
  }
  return false;
}

const Demo = () => {
  const [form] = BizForm.useForm();
  const formValueTime3 = BizForm.useWatch('time3', form);
  const isCheckedTime3 = isAllDay(formValueTime3);

  return (
    <DemoForm
      form={form}
      initialValues={{
        time5: ['14:59:45', '18:00:00'],
        time6: [dayjs('14:59:45', DEFAULT_TIME_FORMAT), dayjs('18:00:00', DEFAULT_TIME_FORMAT)]
      }}
      labelWidth={98}
    >
      <BizFormItemTimeRange label="\u65F6\u95F4" name="time1" />
      <BizFormItemTimeRange
        label="\u89E3\u6784\u5B57\u6BB5"
        name="time2"
        names={['startTime2', 'endTime2']}
        tooltip="\u4F20\u5165names\u4F1A\u81EA\u52A8\u5C06\u503C\u89E3\u6784\u5230\u5F53\u524D\u5C42\u7EA7"
      />
      <BizFormItemTimeRange
        label="\u5FEB\u901F\u9009\u62E9"
        name="time3"
        names={['startTime3', 'endTime3']}
        contentAfter={
          <Checkbox
            style={{ whiteSpace: 'nowrap', marginRight: -8 }}
            checked={isCheckedTime3}
            onChange={() => {
              form.setFieldsValue({
                time3: isCheckedTime3 ? undefined : ['00:00:00', '23:59:59']
              });
            }}
          >
            24\u5C0F\u65F6
          </Checkbox>
        }
      />
      <BizFormItemTimeRange label="\u65F6\u5206" name="time4" format="HH:mm" />
      <BizFormItemTimeRange label="\u9ED8\u8BA4\u503C1" name="time5" tooltip="\u652F\u6301string\u683C\u5F0F" />
      <BizFormItemTimeRange label="\u9ED8\u8BA4\u503C2" name="time6" tooltip="dayjs\u683C\u5F0F" />
    </DemoForm>
  );
};

export default Demo;
