// \u8F6C\u6362\u4E3A UploadFile \u5BF9\u8C61\u3002
// \u9002\u7528\u4E8E\u8BE6\u60C5\u9875\u56FE\u7247\u5C55\u793A\u3001\u8868\u5355\u56DE\u663E
export function transformUploadFile<T = any>(
  fileId?: string | string[]
  // enabledParseZip = true
): Promise<UploadFile<T>[]> {
  if (!fileId) {
    return Promise.resolve([]);
  }

  const ids = castArray(fileId);
  const tasks: Promise<{ url: string; fileId: string }>[] = [];

  ids.forEach((id) => {
    tasks.push(
      asyncMemo.run(
        () =>
          // \u5982\u679C\u6709\u7279\u6B8A\u5904\u7406\u53EF\u4EE5\u5728\u6B64\u6B21\u4FEE\u6539\uFF0C\u4F8B\u5982\u89E3\u538Bzip\u6587\u4EF6\uFF08\u6CE8\u610F\u4FEE\u6539\u7C7B\u578B\u548C\u540E\u7EED\u5904\u7406\uFF09
          downloadFile(id)
            // .then((res) => compatible(res.data, id, enabledParseZip))
            .then((res) => ({ url: res.data, fileId: id }))
            .catch((error) => {
              return Promise.reject({ error, message: '\u6587\u4EF6\u52A0\u8F7D\u5931\u8D25', fileId: id });
            }),
        id
      )
    );
  });

  return Promise.allSettled(tasks).then((result) =>
    result.map((item) => {
      if (item.status === 'fulfilled') {
        return wrapperUploadFile({
          url: item.value.url,
          name: item.value.url,
          response: {
            fileId: item.value.fileId
          }
        });
      }

      return wrapperUploadFile({
        status: 'error',
        error: item.reason.message,
        response: {
          fileId: item.reason.fileId
        }
      });
    })
  );
}

// \u83B7\u53D6 UploadFile \u6587\u4EF6ID
export function getIdByUploadFile(fileList: UploadFile[], nil: false): (string | undefined)[];
export function getIdByUploadFile(fileList: UploadFile[], nil?: true): string[];
export function getIdByUploadFile(fileList: any, nil = true) {
  const result: string[] = [];
  if (isArray(fileList)) {
    fileList.forEach((item) => {
      if (item && typeof item === 'object' && typeof item.response === 'object') {
        if (!nil || item.response.fileId) {
          result.push(item.response.fileId);
        }
      }
    });
  }
  return result;
}

// \u6279\u91CF\u52A0\u8F7D\u6587\u4EF6
// \u9002\u7528\u4E8E\u8BE6\u60C5\u9875\u56FE\u7247\u5C55\u793A\u3001\u8868\u5355\u56DE\u663E
export const batchToUploadFile = async (data: Record<string, any>) => {
  const result: Record<string, UploadFile[]> = {};
  const tasks: Promise<any>[] = [];
  Object.keys(data).forEach((key) => {
    const value = data[key];
    tasks.push(
      transformUploadFile(value).then((res) => {
        result[key] = res;
        return res;
      })
    );
  });
  await Promise.all(tasks);
  return result;
};
