import { FormInstance } from 'antd';
import { BizTable, BizTableActionType, BizTableProps, BizTableRequest } from 'antd-more';
import { Cache } from 'cache2';

type RequestParams = Parameters<BizTableRequest>[0];

const memoryCache = new Cache<{
  formValues: any;
  params: RequestParams;
}>('biz-table-with-cache');
const clearCache = (key?: string | string[]) => {
  if (key) {
    memoryCache.del(key);
  } else {
    memoryCache.clear();
  }
};

interface BizTableWithCacheProps extends Omit<BizTableProps, 'formRef'> {
  cacheKey: string;
  formRef?: React.RefObject<FormInstance | undefined>;
  manual?: boolean; // \u5916\u90E8\u624B\u52A8\u8C03\u7528\u8BF7\u6C42
}

const BizTableWithCache: React.FC<BizTableWithCacheProps> & {
  clearCache: typeof clearCache;
} = ({
  cacheKey,
  request,
  pagination,
  autoRequest,
  actionRef: outerActionRef,
  formRef: outerFormRef,
  manual = false,
  asyncOptions,
  ...restProps
}) => {
  const cache = memoryCache.get(cacheKey);
  const [firstRender, setFirstRender] = useState(true);
  const innerFormRef = useRef<FormInstance>(undefined);
  const formRef = outerFormRef || innerFormRef;
  const innerActionRef = useRef<BizTableActionType>(undefined);
  const actionRef = outerActionRef || innerActionRef;
  const internalRequest: BizTableRequest = async (params, ...args) => {
    const formValues = formRef.current?.getFieldsValue();
    memoryCache.set(cacheKey, {
      formValues,
      params
    });

    return request!(params, ...args);
  };

  useEffect(() => {
    const cacheValue = memoryCache.get(cacheKey);
    if (!manual && (autoRequest !== false || cacheValue)) {
      formRef.current?.setFieldsValue(cacheValue?.formValues);
      actionRef.current?.submitAndCurrent(cacheValue?.params.current || 1);
    }
    // eslint-disable-next-line react-hooks/set-state-in-effect
    setFirstRender(false);
  }, [autoRequest, manual, cacheKey, formRef, actionRef]);

  return (
    <BizTable
      request={internalRequest}
      autoRequest={false}
      pagination={
        pagination !== false ? { pageSize: cache?.params.pageSize, ...pagination } : false
      }
      formRef={formRef}
      actionRef={actionRef}
      asyncOptions={{
        cacheKey,
        loadingDelay: firstRender && cache ? 1200 : undefined,
        ...asyncOptions
      }}
      {...restProps}
    />
  );
};

BizTableWithCache.clearCache = clearCache;

export default BizTableWithCache;
