import { BizForm } from 'antd-more';
import ItemMentionsExpression from './ItemMentionsExpression';

const FIELDS = ['\u5C0F\u989D\u53CC\u514D', '\u4EA4\u6613\u7C7B\u578B', '\u4EA4\u6613\u91D1\u989D'];

const expressionCode = '#rule.\u5C0F\u989D\u53CC\u514D && (#rule.\u4EA4\u6613\u7C7B\u578B || #rule.\u4EA4\u6613\u91D1\u989D)';
const processServerExpressionCode = (expressionCode: string) => {
  return expressionCode
    .replace(/#rule\\./g, '@')
    .replace(/&&/g, '&')
    .replace(/\\|\\|/g, '|');
};
const transformExpressionCode = (expressionCode: string) => {
  return expressionCode.replace(/@/g, '#rule.').replace(/&/g, '&&').replace(/\\|/g, '||');
};

const ExpressionMentions: React.FC = () => {
  return (
    <BizForm
      initialValues={{
        expressionCodes: processServerExpressionCode(expressionCode)
      }}
      onFinish={(values) => {
        console.log('values', values);
        console.log('transform values', {
          expressionCode: transformExpressionCode(values.expressionCodes)
        });
      }}
    >
      <ItemMentionsExpression
        label="\u8868\u8FBE\u5F0F"
        name="expressionCodes"
        options={FIELDS.map((item) => ({
          value: item,
          label: item
        }))}
      />
    </BizForm>
  );
};

export default ExpressionMentions;
